import React from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import home from './Pages/home';

import './App.css';

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route index element={home}
          />
        </Routes>
      </Router>
    </>
  );
}

export default App;
